import React, { useState, useEffect } from "react";

const Employee = props => {
  console.log("EMPLOYEE PROPS", props);
  const [employees, setEmployees] = useState(props.data);

  console.log("props employee", props);
  return (
    <div key={employees.data._id}>
      <h3>{employees}</h3>
      <h3>Age: {employees.age}</h3>
      <h3>Eye color: {employees.eyeColor}</h3>
      <h3>Gender: {employees.gender}</h3>
      <h3>Company: {employees.company}</h3>
      <h3>Email: {employees.email}</h3>
      <h3>Phone: {employees.phone}</h3>
      <h3>Address: {employees.address}</h3>
    </div>
  );
};

export default Employee;
